import React, { Component } from 'react';
import './App.css';
import { Provider } from 'react-redux';
import configureStore from './store/store.js';

class App extends Component {
  render() {
    return (
      <Provider store={configureStore()}>
        <div className="App">
          React Redux
        </div>
      </Provider>
    );
  }
}

export default App;
